import React from 'react'

function Nav() {
    return (
        <div className="nav">
            <img src="https://pmcvariety.files.wordpress.com/2020/05/netflix-logo.png?w=600" 
            alt="Netflix logo"
            className="nav__logo"/>

        </div>
    )
}

export default Nav
